import React from 'react';
import 'bootstrap/dist/css/bootstrap.min.css';
import Header from './Components/Header'
import TaskBar from './Components/TaskBar'
import TaskList from './Components/TaskList'



function App() {
  return (
    <div>

      <Container>
        <Row>
          <Col><Header /></Col>
          <Col> <TaskBar /></Col>
          <Col>  <TaskList /></Col>
        </Row>
      </Container>


    </div>
  );
}

export default App;
